import { Navbar, Nav, Container} from 'react-bootstrap';

function Header(){
    return(
      <Navbar bg="dark" variant="dark" className='navbar_header'>
        <Container>
          <Navbar.Brand>Apple Mall</Navbar.Brand>
          <Nav className="me-auto">
          </Nav>
        </Container>
      </Navbar>
    );
}

export default Header;
